import React from "react";

import {
  CardContainer,
  CardWrapper,
  CardH3,
  CardImg,
  CardP,
  CardCodeButton,
  CardFooter,
  CardLiveButton,
  CardTechIcons,
} from "../Cards/CardsStyles";

export default function Cards() {
  return (
    <>
      <CardContainer>
        <CardWrapper id="projects">
          <CardH3>test</CardH3>
          <CardImg>
            {/* <a href={props.url}><img src={props.image} alt="MIA" /></a> */}
          </CardImg>
          <CardP>test</CardP>
          <CardCodeButton>Source Code</CardCodeButton>
          <CardFooter>
            <CardLiveButton>Live</CardLiveButton>
            <CardTechIcons>Icons</CardTechIcons>
          </CardFooter>
        </CardWrapper>
      </CardContainer>
    </>
  );
}
